  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Blackwater NWR
  outlines Refuge accomplishments from January through April of 1944. The report begins
  by summarizing the weather conditions and water conditions during this period. Wildlife-
  including migratory birds, upland game birds, furbearers, predators, rodents, mammals,
  and raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, and wildfires. Resource management is outlined;
  topics include fur harvesting. A progress report on field investigations and applied
  research is also provided. The public relations section of the report describes
  Refuge visitors. N-R forms and photographs are attached.\",\n\t\"license_title\":
